using TheArtOfDev.HtmlRenderer.PdfSharp;

Console.WriteLine("Start");

var html = @"
<div>
    PNG test:
    <br/>
    <img alt='flag_png' style='width:100%;max-width:250px;' src='data:image/png;base64,' />
    <br/>
    JPEG test:
    <br/>
    <img alt='flag_png' style='width:100%;max-width:250px;' src='data:image/jpeg;base64,' />
    <br/>
    <br/>
    <span style='color:red'>Red</span> <span style='color:#00f'>Blue</span>
    <br/>
    <u>Underline</u>
    <span style='text-decoration:underline'>Underline</span>
    <br/>
    <b>Bold</b> <i>Italic</i> <b><i>Bold/italic</i></b>
    <span style='font-weight:bold;'>Bold</span> <span style='font-style: italic;'>Italic</span> <span style='font-weight:bold;font-style:italic;'>Bold/italic</span>
    <br/>
    <span style='font-size:20px;'>Font size 20px</span>
    <br/>
    Unordered list test:
    <br/>
    <ul>
        <li>one</li>
        <li>two</li>
        <li>
            <ul>
                <li>one</li>
                <li>two</li>
            </ul>
        </li>
        <li>four</li>
    </ul>
    Ordered list test:
    <br/>
    <ol>
        <li>one</li>
        <li>two</li>
        <li>
            <ol>
                <li>one</li>
                <li>two</li>
            </ol>
        </li>
        <li>four</li>
    </ol>
</div>
";

var config = new PdfGenerateConfig
{
    PageSize = PdfSharpCore.PageSize.A4,
    MarginBottom = 35,
    MarginLeft = 35,
    MarginTop = 35,
    MarginRight = 35,
    PageOrientation = PdfSharpCore.PageOrientation.Portrait,
};

using (var doc = PdfGenerator.GeneratePdf(html, config))
{
    doc.Save(@"result.pdf");
}

Console.WriteLine("done");


